import React, { useState, useEffect } from "react";
import axios from "axios";

function CompetitorAnalysis() {
  const [username, setUsername] = useState("");
  const [channelData, setChannelData] = useState(null);
  const [videos, setVideos] = useState([]);
  const [keywordAnalysis, setKeywordAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // ‚úÖ **Fetch Competitor Data**
  const fetchCompetitorData = async () => {
    setLoading(true);
    setError(null);

    try {
      console.log(`üì° Fetching data for: ${username}`);

      const response = await axios.post("http://localhost:5000/analyze", {
        username,
      });

      console.log("‚úÖ Data Received:", response.data);

      if (response.data.error) {
        throw new Error(response.data.error);
      }

      setChannelData({
        title: response.data.channelData.title,
        subscribers: response.data.channelData.subscriberCount,
      });

      setVideos(response.data.videos);
      setKeywordAnalysis(response.data.keywordAnalysis);

    } catch (err) {
      console.error("‚ùå Error fetching data:", err);
      setError("Failed to fetch data. Check the username and API.");
    }

    setLoading(false);
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h2>üîé YouTube Competitor Analysis</h2>

      {/* ‚úÖ **Input for YouTube Channel Name** */}
      <input
        type="text"
        placeholder="Enter YouTube Channel Name"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
        style={{ padding: "8px", marginRight: "10px" }}
      />
      <button onClick={fetchCompetitorData} style={{ padding: "8px" }}>
        Get Analysis
      </button>

      {loading && <p>‚è≥ Loading...</p>}
      {error && <p style={{ color: "red" }}>‚ùå {error}</p>}

      {/* ‚úÖ **Display Channel Info** */}
      {channelData && (
        <div>
          <h3>üé• Channel: {channelData.title}</h3>
          <p>üìä Subscribers: {channelData.subscribers}</p>
        </div>
      )}

      {/* ‚úÖ **Display Video Data** */}
      <h3>üì∫ Latest 10 Videos</h3>
      <ul>
        {videos.map((video) => (
          <li key={video.videoId}>
            <a
              href={`https://www.youtube.com/watch?v=${video.videoId}`}
              target="_blank"
              rel="noopener noreferrer"
            >
              {video.title}
            </a>
            <p>üëÄ Views: {video.views} | üëç Likes: {video.likes} | üí¨ Comments: {video.comments}</p>
          </li>
        ))}
      </ul>

      {/* ‚úÖ **Display Keyword Analysis** */}
      {keywordAnalysis && (
        <div>
          <h3>üìà Keyword Analysis</h3>
          <p>
            <strong>üîë Top Keywords:</strong> {keywordAnalysis.keywords?.join(", ")}
          </p>
          <p>
            <strong>üìå Top Bigrams:</strong> {keywordAnalysis.bigrams?.join(", ")}
          </p>
          <p>
            <strong>üìå Top Trigrams:</strong> {keywordAnalysis.trigrams?.join(", ")}
          </p>
          <p>
            <strong>üìä TF-IDF Scores:</strong> {JSON.stringify(keywordAnalysis.tfidfScores, null, 2)}
          </p>
          <p>
            <strong>üìä Sentiment Score:</strong> {keywordAnalysis.avgSentiment.toFixed(2)}
          </p>

          {/* ‚úÖ **Display Topic Modeling (LDA) Properly** */}
          <h3>üìù Topic Modeling</h3>
          <ul>
            {keywordAnalysis.topics.map((topic, index) => (
              <li key={index}>üìå {topic}</li>
            ))}
          </ul>

          {/* ‚úÖ **Best Suggested Keywords for the Next Video** */}
          <h3>üéØ Suggested Keywords for Your Next Video</h3>
          <p>{keywordAnalysis.suggestedKeywords?.join(", ")}</p>
        </div>
      )}
    </div>
  );
}

export default CompetitorAnalysis;
